from rdkit import Chem
import numpy as np
import multiprocessing as mp

def custom_sort_tuple(x):
    # Assign integer values to each type for comparison
    type_values = {int: 0, float: 1, str: 2}
    return (type_values[type(x)], x)

def custom_sort_list_tuple(x):
    # Assign integer values to each type for comparison
    type_values = {int: 0, float: 1, str: 2}
    return tuple((type_values[type(i)], i) for i in x)


def make_mol(s: str, keep_h: bool, add_h: bool):
    """
    Builds an RDKit molecule from a SMILES string.

    :param s: SMILES string.
    :param keep_h: Boolean whether to keep hydrogens in the input smiles. This does not add hydrogens, it only keeps them if they are specified.
    :return: RDKit molecule.
    """
    if keep_h:
        mol = Chem.MolFromSmiles(s, sanitize=False)
        Chem.SanitizeMol(mol, sanitizeOps=Chem.SanitizeFlags.SANITIZE_ALL ^ Chem.SanitizeFlags.SANITIZE_ADJUSTHS)
    else:
        mol = Chem.MolFromSmiles(s)
    if add_h:
        mol = Chem.AddHs(mol)
    return mol

def get_vocab_v2(df):
    atom_list = []
    strange_list = []
    df = df.to_numpy()
    for i in tqdm(range(len(df))):

        mol = make_mol(df[i], False, False)
        for atom in mol.GetAtoms():
            neighbor_charge = [x.GetFormalCharge() for x in atom.GetNeighbors()]
            neighbor = [neigh for neigh in atom.GetNeighbors()]
            second_neighbor = [x.GetNeighbors() for x in neighbor]
            second_symbol = []
            for tup in second_neighbor:
                for nei in tup:
                    second_symbol.append(nei.GetSymbol())
            neighbor_charge.extend(second_symbol)
            temp = []
            temp.append(atom.GetSymbol())
            temp.append(atom.GetFormalCharge())
            for charge in neighbor_charge:
                temp.append(charge)
            temp = set(temp)
            temp = tuple(temp)
            temp = tuple(sorted(temp, key=custom_sort_tuple))
            atom_list.append(temp)

            if abs(atom.GetFormalCharge()) > 100:
                strange_list.append((df, atom.GetSymbol(), atom.GetFormalCharge()))
        atom_list = list(set(atom_list))


    atom_set = list(set(atom_list))
    return atom_set, strange_list

def get_vocab_v2_parallel(df):
    num_processes = mp.cpu_count()
    df_split = np.array_split(df, num_processes)
    pool = mp.Pool(num_processes)
    results = []
    for result in tqdm(pool.imap_unordered(get_vocab_v2, df_split), total=num_processes):
        results.append(result)
    pool.close()
    pool.join()

    atom_list = []
    strange_list = []
    for result in results:
        atom_list.extend(result[0])
        strange_list.extend(result[1])

    atom_set = list(set(atom_list))
    return atom_set, strange_list

